import React from "react";

class Ninjas extends React.Component{
    render(){
        const {name , age ,belt} = this.props;
        return(
            <div>
                <div> {name}</div>
                <div>{age}</div>
                <div>{belt}</div>
            </div>
        )
    }
}

export default Ninjas;
